  return (
    <div>
      <div >
        <strong>U13 M2 </strong>
        <br />
        equipe composer de kevin cedric mateo julien quentin..
      </div>
      <div>
        <img src="../img/equipes/U13-M2.jpg" alt="equipe U13 M2" />
      </div>
      <div>
      <a href="/Actualites"><button>resultats et calendrier</button></a>
      </div>
    </div>
  );
};

